import React, { useState } from 'react';
import Hazardform from './Report/Hazardform';
import {Link,Outlet} from 'react-router-dom'
import Accidentform from './Report/Accidentform'
import Trafficform from './Report/Trafficform'
function Report(){
  return(
    <div className='report'>
      <div className='reportnav'>
        <Link to="/Report/Accidentform">Accident</Link>
        <Link to="/Report/Hazardform">Hazard</Link>
        <Link to="/Report/Trafficform">Traffic</Link>
      </div>
      <Outlet />
    </div>
  )
}
export default Report
